def load_review():
    print('READING REVIEW FILE')
    review = ps.read_json(r'/opt/data/initial_load/review.json').head(1000)
    review = review[review['business_id'].isin(more_reviews)]
    print('DROPPING DUPLICATED ROWS')
    review = review.drop_duplicates()
    print('NORMALIZING DATES')
    review['date'] = review['date'].apply(transform_funcs.transform_dates).dt.strftime('%Y-%m-%d')

    review.rename(columns=lower_col_names(review.columns), inplace=True)

    session = connect_to_astra()

    print('DROPPING TABLE IF EXISTS')
    session.execute("DROP TABLE IF EXISTS yelp.review;")

    print('CREATING TABLE')
    session.execute("""
    CREATE TABLE IF NOT EXISTS yelp.review(
        review_id text,
        user_id text,
        business_id text,
        stars float,
        date text,
        text text,
        useful int,
        funny int,
        cool int,
        PRIMARY KEY(review_id))
    """)

    sleep(5)
    print('UPLOADING DATAFRAME TO CASSANDRA')
    review.to_spark().write\
    .format("org.apache.spark.sql.cassandra")\
    .mode('append')\
    .options(table="review", keyspace="yelp")\
    .save()
    print('DONE')



